INSERT INTO `Movies` VALUES (1,'Wunderland','Christmas 1944, The Germans make one final push against the attacking allied armies in the West. Lt. Robert Cappa and his platoon of 2nd Infantry Division soldiers have been ordered to hold a vital road junction against the German aggressors. Cappa and his men must find their faith and strength to stand against their enemy in the epic fight know as \"The Battle of The Bulge.',5.8,2018,89,437456583,'https://yts.am/assets/images/movies/wunderland_2018/medium-cover.jpg','https://yts.am/torrent/download/66ABF7427359B5F3A870285C7F2168F901005126'),(2,'Always Be with You','David a taxi driver who is doomed with cancer kills hotel owner Patrick in car accident, then Patrick\'s girl friend takes over his hotel by the lake in Hong Kong. Where is haunted by serial suicidal accidents. The car accident which combined with suicidal act by a girl Xiao-Hong also instigates pick pocket, Zhi-qiang, police Sam\'s spooky incidents.',5.7,2017,91,163672126,'https://yts.am/assets/images/movies/always_be_with_you_2017/medium-cover.jpg','https://yts.am/torrent/download/74843AC4B75A1197FB94D9EBB199201B5F91247D'),(3,'Welcome to the North','Now in the Far North (i.e. Milan!), Alberto has accepted to manage a program for efficiency improvement in the Italian Post. He devotes all his time and all his energy to this noble (?) task and neglects his wife Silvia, which of course annoys her beyond limits. Things do not fare much better in Castellabate where it is rather Maria, Matta\'s wife, who gets on his nerves by always blaming him for his lack of ambition. One day, due to a misunderstanding, Mattia is transferred to... Milan! And on w',5.3,2012,164,339180539,'https://yts.am/assets/images/movies/welcome_to_the_north_2012/medium-cover.jpg','https://yts.am/torrent/download/ED22E30C668CE275EF8C826BC9FF57514B7C62B4'),(4,'Lucknow Central','The story is set in the backdrop of a jail, with music at its core. Walls might muffle them but cages only reverberate them louder. Situated deep in the heartland of India, within the by-lanes of Lucknow is story of a man who had something to say. Or should we say sing.',6.1,2017,79,361989796,'https://yts.am/assets/images/movies/lucknow_central_2017/medium-cover.jpg','https://yts.am/torrent/download/CE8AD61A53D4F959260FB6815125B65CEF3CE411'),(5,'2048: Nowhere to Run','Gentle Sapper, a replicant, unleashes his true power when he sees his loved ones in trouble.',6.9,2017,83,428423863,'https://yts.am/assets/images/movies/2048_nowhere_to_run_2017/medium-cover.jpg','https://yts.am/torrent/download/753FD6FA3F3713297978527B4FCA484692B56821'),(6,'A Taxi Driver','May 1980. A Seoul taxi driver named Man-seob (SONG Kang-ho) comes across an offer too good to be true. If he drives a foreign passenger from Seoul down to Gwangju and back again before the curfew, he\'ll be paid the unthinkable sum of 100,000 won - enough to cover several months of unpaid rent. Without stopping to ask the details, he picks up the German reporter Peter (Thomas Kretschmann) and sets off along the highway. Although stopped by police roadblocks at the edge of Gwangju, Man-seob is des',7.9,2017,88,339221472,'https://yts.am/assets/images/movies/a_taxi_driver_2017/medium-cover.jpg','https://yts.am/torrent/download/127B09127BC7756B4472B317082D79A2F73EF666'),(7,'Midnight Runners','Hwang Ki Joon, Mr Action, and Kang Hee Yeol, Mr Bookworm, are two best friends but contradictory students at Korean National Police University. They accidentally witness a kidnapping and decide to work together to track it down.',7.2,2017,152,416498723,'https://yts.am/assets/images/movies/midnight_runners_2017/medium-cover.jpg','https://yts.am/torrent/download/522DA8BB70CC2BEEF3C6BC18F2A5CA7F66E7C59F'),(8,'The Death of Stalin','Follows the Soviet dictator\'s last days and depicts the chaos of the regime after his death.',7.6,2017,123,146820629,'https://yts.am/assets/images/movies/the_death_of_stalin_2017/medium-cover.jpg','https://yts.am/torrent/download/CC4EA475E8A73D5FBE035BDB6805DB98E5AEB6D1'),(9,'Zombies','Disney\'s \"ZOMBIES\" is a music and dance filled story set in the fictitious world of Seabrook, a cookie-cutter community brimming with perky conformity, 50 years after a zombie apocalypse. Today, the zombies pose no threat, but are required to live in Zombietown, an isolated, rundown community infused with their unique creative spirit. When zombies are finally allowed to enroll in Seabrook High School, the charming, charismatic zombie Zed, who is determined to play football, meets freshman Addiso',6.7,2018,124,68118923,'https://yts.am/assets/images/movies/zombies_2018/medium-cover.jpg','https://yts.am/torrent/download/5806311C61C80F8817FC6E3DEF2ABA75EE1CF0B1'),(10,'Along Came Jones','Riding into Payneville, easy-going cowboy Melody Jones is mistaken by the townsfolk for notorious gunman Monte Jarrad. The real Jarrad is hiding out wounded on the ranch of childhood sweetheart Cherry. She has the idea of sending Jones off to decoy the pursuing posse, but once he\'s met Cherry, Jones has other plans.',6.6,1945,60,342722803,'https://yts.am/assets/images/movies/along_came_jones_1945/medium-cover.jpg','https://yts.am/torrent/download/D2FBAFA1F0DDF6D04F45E07B4C305DF230C9E67E'),(11,'The Battleship Island','During the Japanese colonial era, roughly 400 Korean people, who were forced onto Battleship Island (\"Hashima Island\") to mine for coal, attempt to a dramatic escape.',7.1,2017,105,228910087,'https://yts.am/assets/images/movies/the_battleship_island_2017/medium-cover.jpg','https://yts.am/torrent/download/638BEC56730ADDD662B0B213E6830A016C332434'),(12,'Paradox','Hong Kong police negotiator Lee Chung-Chi has learned that his 16 year old daughter Wing-Chi has disappeared while in Thailand. He travels to Thailand and teams up with Chinese officer Tsui Kit and his partner, Tak, as they face off against American gangster Sacha, who is operating a black market organ smuggling ring. A series of clues lead Chung-Chi to not only learn the fate of his daughter, but overcome the odds to stop the ring once and for all.',6.8,2017,105,12991897,'https://yts.am/assets/images/movies/paradox_2017/medium-cover.jpg','https://yts.am/torrent/download/7B7960A0FCA45EB002720C800B1C014BAF599908'),(13,'The Dead Next Door','The government sets up a Zombie squad after an epidemic has made the world run rampant with living corpses. Raimi, Mercer, Kuller, and others head off to Ohio to try and find a cure to the epidemic but soon run into a crazy cult of zombie lovers who are set on preserving the zombies and letting a new world be born because they believe that it\'s God\'s will. When Mercer gets infected with the zombie virus, Raimi and the others must work quickly to find a cure and avoid the cult.',5.2,1989,120,418846449,'https://yts.am/assets/images/movies/the_dead_next_door_1989/medium-cover.jpg','https://yts.am/torrent/download/28554D6F903555D6284301EA467FE7B3FA08D4A8'),(14,'Captain from Castile','Spain, 1518: young caballero Pedro De Vargas offends his sadistic neighbor De Silva, who just happens to be an officer of the Inquisition. Forced to flee, Pedro, friend Juan Garcia, and adoring servant girl Catana join Cortez\' first expedition to Mexico. Arriving in the rich new land, Cortez decides to switch from exploration to conquest...with only 500 men. Embroiled in continuous adventures and a romantic interlude, Pedro almost forgets he has a deadly enemy...',7,1947,174,347659755,'https://yts.am/assets/images/movies/captain_from_castile_1947/medium-cover.jpg','https://yts.am/torrent/download/1E6589063244FA2A68BDB3BFA22246F857374EEB'),(15,'The Fortune','The early 1900\'s with its Mann-Act (disallowing women to be transported across State lines for immoral reasons) brings a married man to devise a scheme for taking his upper-class girlfriend away with him... he simply has her marry his unmarried buddy. However, it doesn\'t take very long before both men start laying claim to her affection... until, that is, she\'s about to be cut out of her parent\'s fortune. So, a new scheme is devised, which only adds to their problems, as well as to the sly whims',5.7,1975,148,244190081,'https://yts.am/assets/images/movies/the_fortune_1975/medium-cover.jpg','https://yts.am/torrent/download/1900A9CB2F593AF3EB69E2D5A02CAB6BB315D3DF'),(16,'Burn Motherfucker, Burn!','Explores the roots of civil unrest in California and the relationship between African Americans and LAPD.',6.8,2017,175,455706081,'https://yts.am/assets/images/movies/burn_motherfucker_burn_2017/medium-cover.jpg','https://yts.am/torrent/download/DCBDBBF4769A5222B6373E60FAE90F384968F5FD'),(17,'Bright Lights: Starring Carrie Fisher and Debbie Reynolds','Carrie Fisher and Debbie Reynolds star in a tender portrait of Hollywood royalty in all its eccentricity. From the red carpet to the back alleys behind it, the documentary is about the bonds of family love, which are beautifully bitter-sweet.',8,2016,113,188700699,'https://yts.am/assets/images/movies/bright_lights_starring_carrie_fisher_and_debbie_reynolds_2016/me','https://yts.am/torrent/download/66035DE94E836CF2852B7BF4C44DBAAA3A03C7F3'),(18,'Hellraiser: Judgment','Detectives Sean and David Carter are on the case, to hunt down a gruesome serial killer terrorising the city. Joining forces with Detective Christine Egerton, they dig deeper into a spiralling maze of horror that may not be of this world. Could the judgement awaiting the killer\'s victims also be waiting for Sean?',4.3,2018,149,418124000,'https://yts.am/assets/images/movies/hellraiser_judgment_2018/medium-cover.jpg','https://yts.am/torrent/download/1980E5EB2E1D6EC383B46D974EB979EE2357E04D'),(19,'Mountain','An experience about the highest peaks around the world.',7.4,2017,146,218330488,'https://yts.am/assets/images/movies/mountain_2017/medium-cover.jpg','https://yts.am/torrent/download/2BB500A06C1D64672A9DA3B0EEDE2A61725EF113'),(20,'Your Name','Mitsuha is the daughter of the mayor of a small mountain 