g','https://yts.am/torrent/download/8D7079433765B7EB641D7D37C861F6E832E2F53F'),(493,'The Little Hours','On the run from the battle-seasoned Lord Bruno for sleeping with his wife, the handsome and willing servant, Massetto, flees to the safety of the woods during the warm and peaceful summer of 1347. There, after a chance encounter with the always boozy but merciful Father Tommasso, the young charmer will find refuge into his convent\'s sanctuary, on one condition: to pretend he is a deaf-mute. However, Massetto\'s tempting presence will unavoidably upset the already frail balance of things within th',5.9,2017,87,207288228,'https://yts.am/assets/images/movies/the_little_hours_2017/medium-cover.jpg','https://yts.am/torrent/download/6EC6852A86E353E9961D7090CC23CBCDD0A321BD'),(494,'68 Kill','It started with a couple dead bodies and $68,000 in stolen cash. Chip Taylor\'s girlfriend Liza had the perfect plan to rip off her rich sugar daddy. It should have been an easy in and out kind of deal. Nobody would get hurt and they would come out of it with enough loot to solve their problems. But things started going wrong as soon as they were inside the rich man\'s house, and for Chip it was only the beginning of the longest, most terrifying ride of his life.',6,2017,119,212394368,'https://yts.am/assets/images/movies/68_kill_2017/medium-cover.jpg','https://yts.am/torrent/download/96103E527D7FE7292CC944806720EA9C78A25E65'),(495,'ClownTown','A group of friends get stranded in a seemingly deserted small town and find themselves stalked by a violent gang of psychopaths dressed as clowns.',3.9,2016,158,461483005,'https://yts.am/assets/images/movies/clowntown_2016/medium-cover.jpg','https://yts.am/torrent/download/E88D160F81B11CA0DB9BE7C990361C937B7B0FC0'),(496,'Killing Hasselhoff','A man in a high stakes celebrity death pool quickly loses everything - his business, his bank account, his home, his fiance. He snaps, then realizes the only way to get his life back on track. He\'ll have to murder his own celebrity. He\'ll have to kill Hasselhoff.',4.3,2017,108,254583978,'https://yts.am/assets/images/movies/killing_hasselhoff_2017/medium-cover.jpg','https://yts.am/torrent/download/609DFB870557CD1EBC073B28968205828416B201'),(497,'Dirty Dancing','A musical re-imagining of the 1987 film, Dirty Dancing (1987).',3.1,2017,137,79539893,'https://yts.am/assets/images/movies/dirty_dancing_2017/medium-cover.jpg','https://yts.am/torrent/download/E82E747FD2EF622E1B5EB1B1796D0CEE4B6BB9DC'),(498,'Wrecker','Best friends Emily and Lesley go on a road trip to the desert. When Emily decides to get off the highway and take a \"short cut,\" they become the target of a relentless and psychotic trucker who forces them to play a deadly game of cat and mouse.',3.5,2015,145,307710911,'https://yts.am/assets/images/movies/wrecker_2015/medium-cover.jpg','https://yts.am/torrent/download/2B440A7F20BC5AC97FCA6E6E27F295C01A8DDEDA'),(499,'6 Days','In April 1980, armed gunmen stormed the Iranian Embassy in Princes Gate, London and took all inside hostage. Over the next six days a tense standoff took place, all the while a group of highly trained soldiers from the SAS prepared for a raid the world had never seen.',6.2,2017,121,159835982,'https://yts.am/assets/images/movies/6_days_2017/medium-cover.jpg','https://yts.am/torrent/download/52F95DD4D5F0AA95237AEA81F25B851193BAC75D'),(500,'Spider-Man: Homecoming','Thrilled by his experience with the Avengers, Peter returns home, where he lives with his Aunt May, under the watchful eye of his new mentor Tony Stark, Peter tries to fall back into his normal daily routine - distracted by thoughts of proving himself to be more than just your friendly neighborhood Spider-Man - but when the Vulture emerges as a new villain, everything that Peter holds most important will be threatened.',7.5,2017,74,396700133,'https://yts.am/assets/images/movies/spider_man_homecoming_2017/medium-cover.jpg','https://yts.am/torrent/download/4415109A20908D55CD42EAF24DF9AAF89F7B0F7B');
